Information
------------------------------

Unearthing Ancient Secrets: Collection 1
New forensic techniques are altering our understanding of the past, and helping to resolve mysteries about the lives of some of the greatest figures in history. In this series, leading experts from around the world apply modern forensic techniques to re-examine the myths and mysteries that have fascinated us for centuries. Among the iconic subjects covered in the series are Tutankhamun's mysterious death, the lives of gladiators in ancient Rome, the fate of Khubilai Khan's fleet, the mystery of the Sphinx, the assassination of Julius Caesar, the alleged suicide of Cleopatra, the identity of Jack the Ripper, and the survivors of the Great Plague

14)  Engineering Ancient Egypt 
The Great Pyramid is not only a Wonder of the Ancient World but was also the world's tallest man-made structure for 3,800 years. Egyptians built this and more with only manpower. Engineering experts work to decode construction the way the ancients did it.

15)  The Search for Sheba 
An investigation has been launched to find a missing person - the legendary, Biblical figure we know as the Queen of Sheba. Immortalized as the lover of King Solomon, who was she? A team excavating an ancient temple believes they have unearthed answers.

16)  Rameses a Murder Mystery 
In the Valley of the Kings a discovery could change our view of the Bible forever. Rameses II was the pharaoh of the Exodus, whose firstborn son died during the 10th plague. New evidence suggests the heir may have been killed by something more sinister.

17)  Secrets of the Valley of the Kings 
In the Valley of the Kings lie tombs of some of the greatest Pharaohs of Ancient Egypt. After 3000 years the secrets of how the Ancient Egyptian craftsmen managed to build such an elaborate subterranean world are being unearthed.

